(1, 1, 2, 'Платье Сицилия', '<p data-spm-anchor-id=\"a2g0v.10010108.1000016/B.i14.7b6148bcniaBlm\" itemprop=\"name\">\n	Многостороннее пикантное платье для женщин любого возраста! Подойдёт для подружек невесты, а также для выхода в свет.\n</p>', 4490, 'plate-sitsiliya', 'plate-sitsiliya_2018-07-24_15-19-00.jpg|plate-sitsiliya5_2018-07-24_15-19-15.jpg', 'CN1', -1, 1, 'Платье Сицилия', 'Платье Сицилия купить, Платье, Сицилия', 'Многостороннее пикантное платье для женщин любого возраста! Подойдёт для подружек невесты, а также для выхода в свет.', '', 0, 0, '', '', '', 1, NULL, 'RUR', 4490, '|', '|', NULL, 0, 1, '', 'Многостороннее пикантное платье для женщин любого возраста!', '2018-10-23 10:38:34', 'шт.'),
(3, 3, 2, 'Платье корсет Агнесса', 'Корсет с юбкой Агнесса&nbsp;Sapugeri представляет собой элегантную форму, которая будет плотно прилегать к телу по длине корсета.<br />\nДанная модель завоевала широкую известность в странах западной Европы и Северной Америки.&nbsp;<br />\nВ этом корсете Вы будете в центре внимания на любой тематической вечеринке.<br />\n<br />\n&nbsp;\n<div>\n	<span style=\"font-size:14px;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Таблица размеров.</strong></span><br />\n	&nbsp;\n</div>\n\n<div style=\"width: 325px;\">\n	<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" width=\"0\">\n		<tbody>\n			<tr>\n				<td style=\"text-align: center;\">\n					Размер\n				</td>\n				<td style=\"text-align: center;\">\n					Талия дюйма\n				</td>\n				<td style=\"text-align: center;\">\n					Талия см\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					XS\n				</td>\n				<td style=\"text-align: center;\">\n					22-24\n				</td>\n				<td style=\"text-align: center;\">\n					55-60\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					S\n				</td>\n				<td style=\"text-align: center;\">\n					24-26\n				</td>\n				<td style=\"text-align: center;\">\n					60-65\n				</td>\n			</tr>\n			<tr>\n				<td data-spm-anchor-id=\"a2g0v.10010108.1000023.i3.13ca6009WC2tNt\" style=\"text-align: center;\">\n					М\n				</td>\n				<td style=\"text-align: center;\">\n					26-28\n				</td>\n				<td style=\"text-align: center;\">\n					65-70\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					L\n				</td>\n				<td style=\"text-align: center;\">\n					28-30\n				</td>\n				<td style=\"text-align: center;\">\n					70-75\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					XL\n				</td>\n				<td style=\"text-align: center;\">\n					30-32\n				</td>\n				<td style=\"text-align: center;\">\n					75-80\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					XXL\n				</td>\n				<td style=\"text-align: center;\">\n					32-34\n				</td>\n				<td style=\"text-align: center;\">\n					80-85\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					3XL\n				</td>\n				<td style=\"text-align: center;\">\n					34-36\n				</td>\n				<td style=\"text-align: center;\">\n					85-90\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					4XL\n				</td>\n				<td style=\"text-align: center;\">\n					36-38\n				</td>\n				<td style=\"text-align: center;\">\n					90-95\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					5XL\n				</td>\n				<td style=\"text-align: center;\">\n					38-40\n				</td>\n				<td style=\"text-align: center;\">\n					95-100\n				</td>\n			</tr>\n			<tr>\n				<td style=\"text-align: center;\">\n					6XL\n				</td>\n				<td style=\"text-align: center;\">\n					40-42\n				</td>\n				<td data-spm-anchor-id=\"a2g0v.10010108.1000023.i1.13ca6009WC2tNt\" style=\"text-align: center;\">\n					100-105\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n', 7890, 'plate-korset-agnessa', 'plate-korset-agnessa4_2018-07-24_15-16-32.jpg', 'CN3', -1, 1, 'Платье корсет Агнесса', 'Платье, корсет, Агнесса', 'Неотразимый корсет Агнесса для тематических вечеринок', '', 0, 0, '', '', '', 0, NULL, 'RUR', 7890, '', '', NULL, 0, 1, '', 'Неотразимый корсет Агнесса для тематических вечеринок!', '2018-10-23 10:32:14', 'шт.'),
(19, 19, 6, 'Майка Loza', 'Хлопковая майка Loza, сделанная из высокого качества ткани, будет стройнить Вашу фигуру.', 670, 'mayka-loza', 'mayka-loza_2018-08-06_16-18-28.jpg|mayka-loza2_2018-08-06_16-18-32.jpg|mayka-loza3_2018-08-06_16-19-19.jpg', 'CN19', -1, 1, 'Майка Loza', 'Майка Loza купить, CN19, Майка, Loza', 'Хлопковая майка Loza, сделанная из высокого качества ткани, будет стройнить Вашу фигуру.', '', 0, 1, '', '', '', 0, NULL, 'RUR', 670, '||', '||', NULL, 0, 1, '', 'Хлопковая майка Loza, сделанная из высокого качества ткани, будет стройнить Вашу фигуру.', '2018-10-23 10:34:21', 'шт.'),
(6, 6, 2, 'Платье Глория', 'Воздушное платье Глория от&nbsp;Bristyle даст Вам преимущество соблазнить любого мужчину!<br />\nСистема вентиляции от автора схемы платья обещает чувствовать себя комфортно даже в самую сильную жару.', 2600, 'plate-gloriya', 'plate-gloriya_2018-07-24_15-24-56.jpg|plate-gloriya2_2018-07-24_15-20-05.jpg', 'CN6', -1, 1, 'Платье Глория', 'Платье Глория купить, CN6, Платье, Глория', 'Воздушное платье Глория от', '', 0, 0, '', '', '', 0, NULL, 'RUR', 2600, '|', '|', NULL, 0, 1, '', 'Воздушное платье Глория от Bristyle', '2018-08-08 12:14:36', 'шт.'),
(7, 7, 2, 'Платье Серсея', 'Очаровательное длинное платье покорит Вашего мужчину всего за 5790 рублей!<br />\nСоткано из шифона и полиэстера трепетными китайскими руками, чтобы Вы его носили и получали удовольствие.', 5790, 'plate-serseya', 'plate-serseya_2018-07-24_15-17-15.jpg|plate-serseya2_2018-07-24_15-17-23.jpg|plate-serseya4_2018-07-24_15-17-33.jpg|plate-serseya3_2018-07-24_15-17-36.jpg', 'CN7', -1, 1, 'Платье Серсея', 'Платье Серсея купить, CN7, Платье, Серсея', 'Очаровательное длинное платье покорит Вашего мужчину всего за 5790 рублей!', '', 0, 0, '', '', '', 0, NULL, 'RUR', 5790, '|||', '|||', NULL, 0, 1, '', 'Очаровательное длинное платье покорит Вашего мужчину всего за 5790 рублей!', '2018-08-08 12:14:25', 'шт.'),
(10, 10, 2, 'Платье Лаура', 'По длинне платье представляет собой мини-юбку. Идеальный вариант для похода в ночной клуб.&nbsp;<br />\n&nbsp;\n<p>\n	<strong>Возврат</strong>\n</p>\n\n<p>\n	Только дефектному&nbsp;товару будет предложен обмен. Дефектная продукция должна быть возвращена в течение 30 дней с даты Вашего заказа. Это может занять до 7 рабочих дней.&nbsp;Покупатель несет ответственность за все дополнительные сборы за доставку.\n</p>', 3990, 'plate-laura', 'plate-laura_2018-07-24_15-40-20.jpg', 'CN10', -1, 1, 'Платье Лаура', 'Платье Лаура купить, CN10, Платье, Лаура', 'По длинне платье представляет собой мини', '', 0, 0, '', '', '', 0, NULL, 'RUR', 3990, '', '', NULL, 0, 1, '', '', '2018-10-23 10:27:32', 'шт.'),
(9, 9, 2, 'Платье Марта', 'Длинное летнее платье с вырезом для тех дам, которые ценят стиль славного города Милана.', 4990, 'plate-marta_9', 'plate-marta5_2018-07-24_15-18-06.jpg|plate-marta3_2018-07-24_15-18-15.jpg|plate-marta2_2018-07-24_15-18-20.jpg', 'CN9', -1, 1, 'Платье Марта', 'Платье Марта купить, CN9, Платье, Марта', 'Длинное летнее платье с вырезом для тех дам, которые ценят стиль славного города Милана.', '', 0, 0, '', '', '', 0, NULL, 'RUR', 4990, '||', '||', NULL, 0, 1, '', 'Длинное летнее платье с вырезом', '2018-10-23 10:32:12', 'шт.'),
(11, 11, 2, 'Платье Роксана', 'Обтягивающая мини-юбка в полоску.', 7190, 'plate-roksana', 'plate-roksana_2018-07-24_16-12-49.jpg|plate-roksana2_2018-07-24_16-12-52.jpg|plate-roksana3_2018-07-24_16-13-04.jpg|plate-roksana4_2018-07-24_16-13-09.jpg', 'CN11', -1, 1, 'Платье Роксана', 'Платье Роксана купить, CN11, Платье, Роксана', 'Обтягивающая мини-юбка в полоску', '', 0, 0, '', '', '', 0, NULL, 'RUR', 7190, '|||', '|||', NULL, 0, 1, '', 'Обтягивающая мини-юбка в полоску.', '2018-07-24 10:27:09', 'шт.'),
(13, 13, 7, 'Фитнес леггинсы', 'Яркие и обтягивающие фитнес леггинсы кислотного цвета помогут преобразить Вашу фигуру в спорт зале!&nbsp;', 499, 'fitnes-legginsy', 'fitnes-legginsy2_2018-07-25_18-48-19.jpg|fitnes-legginsy_2018-07-25_18-48-16.jpg|fitnes-legginsy3_2018-07-25_18-48-22.jpg|fitnes-legginsy4_2018-07-25_18-48-27.jpg', 'CN13', -1, 1, 'Фитнес леггинсы', 'Фитнес леггинсы купить, CN13, Фитнес, леггинсы', 'Яркие и обтягивающие фитнес леггинсы кислотного цвета помогут преобразить Вашу фигуру в спорт зале!', '', 0, 0, '', '', '', 0, NULL, 'RUR', 499, '|||', '|||', NULL, 0, 1, '', 'Яркие и обтягивающие фитнес леггинсы кислотного цвета помогут преобразить Вашу фигуру в спорт зале! ', '2018-10-23 10:32:25', 'шт.'),
(14, 14, 6, 'Майка B-Irika', 'Майка B-irika представлена в виде различных рисунков, которые Вас&nbsp;заинтересуют.<br />\nЕсли любите милого котика или стильный череп, то эта майка B-irika для Вас!', 599, 'mayka-b-irika', 'mayka-b-irika_2018-08-02_17-36-26.jpg|mayka-b-irika2_2018-08-02_17-36-29.jpg', 'CN14', -1, 1, 'Майка B-Irika', 'Майка B-Irika купить, CN14, Майка', 'Если любите милого котика или стильный череп, то эта майка B-irika для Вас!', '', 0, 0, '', '', '', 0, NULL, 'RUR', 599, '|', '|', NULL, 0, 1, '', 'Если любите милого котика или стильный череп, то эта майка B-irika для Вас!', '2018-10-23 10:32:24', 'шт.'),
