(25, 25, 8, 'Samsung Galaxy Note8', 'Samsung Galaxy Note 8 — ультимативный бизнес-смартфон. Гаджет премиум-класса дарит огромный функционал. Экранное разрешение QuadHD+.<br />\nМощный процессор с 8 ядрами \"потянет\" любую игру. Сам экран является изогнутым. В телефоне присутствует поддержка сервиса&nbsp;Samsung Pay.&nbsp;<br />\nSamsung Galaxy Note 8 рассчитан на деловых людей с максимальными требованиями к смартфону.<br />\nПеред покупкой, пожалуйста, уточняйте характеристики, комплектацию, возможности гаджета у наших продавцов-консультантов.&nbsp;&nbsp;', 53470, 'smartfon-samsung-galaxy-note8', 'smartfon-Samsung-Galaxy-Note8_2018-08-08_17-29-25.jpg|smartfon-Samsung-Galaxy-Note82_2018-08-08_17-29-30.jpg', 'CN25', -1, 1, 'Смартфон Samsung Galaxy Note8', 'Смартфон Samsung Galaxy Note8 купить, CN25, Смартфон, Samsung, Galaxy, Note8', 'Samsung Galaxy Note 8 — ультимативный бизнес-смартфон. Гаджет премиум-класса дарит огромный функционал. Экранное разрешение QuadHD+. Мощный процессор Процессор с 8 ядрами заставляет систему «летать»', '', 1, 0, '', '', '', 0, NULL, 'RUR', 53470, '|', '|', NULL, 0, 1, '', '', '2018-10-23 10:36:01', 'шт.'),
