(29, 29, 9, 'Samsung UE49NU7100U', 'LED Телевизор Samsung UE49NU7100U - отличный выбор. Перед покупкой Samsung UE49NU7100U Вы всегда можете проконсультироваться с нашими специалистами. Интернет-магазин Мой магазин - это гарантия низкой цены, оперативной доставки и качественного клиентского сервиса.<br />\n<br />\nФирма-производитель оставляет за собой право на внесение изменений в конструкцию, дизайн и комплектацию приборов без предварительного уведомления. Вся информация на сайте носит справочный характер и не является публичной офертой.', 39590, 'samsung-ue49nu7100u', 'samsung-ue49nu7100u_2018-08-14_18-48-41.jpg|samsung-ue49nu7100u2_2018-08-14_18-48-48.jpg|samsung-ue49nu7100u3_2018-08-14_18-48-52.jpg', 'CN29', -1, 1, 'Samsung UE49NU7100U', 'Samsung UE49NU7100U купить, CN29, Samsung, UE49NU7100U', 'LED Телевизор Samsung UE49NU7100U - отличный выбор и будет достойной покупкой. Перед покупкой Samsung UE49NU7100U Вы всегда можете проконсультироваться с нашими специалистами', '', 0, 0, '', '', '', 0, NULL, 'RUR', 39590, '||', '||', NULL, 0, 1, '', '', '2018-10-23 10:32:17', 'шт.'),
(31, 31, 9, 'LG OLED55C8', 'Подобрать хороший телевизор очень просто. Чем больше диагональ, выше разрешение, новее технология изготовления дисплея, мощнее динамики, тем лучше. Главный вопрос при покупке телевизора заключается в&nbsp;другом&nbsp;— как не&nbsp;переплатить за&nbsp;ненужные опции.', 131000, 'lg-oled55c8', 'LG-OLED55C8_2018-08-16_18-00-40.jpg|LG-OLED55C82_2018-08-16_18-00-46.jpg|LG-OLED55C83_2018-08-16_18-00-49.jpeg|LG-OLED55C84_2018-08-16_18-00-55.jpg|LG-OLED55C85_2018-08-16_18-01-00.jpg', 'CN31', 19, 1, 'LG OLED55C8', 'LG OLED55C8 купить, CN31, LG OLED55C8', 'Подобрать хороший телевизор очень просто. ', '141000', 0, 0, '', '', '', 0, NULL, 'RUR', 131000, '||||', '||||', NULL, 0, 1, '', '', '2018-10-23 10:32:18', 'шт.'),
(32, 32, 9, 'Samsung QE65Q7CAM', '<b>Технология Q&nbsp;HDR 1500</b><br />\nВы&nbsp;увидите невозможное благодаря технологии расширения динамического диапазона Q&nbsp;HDR 1500&nbsp;— изображение глазами режиссера и&nbsp;мельчайшие детали объектов, скрытых в&nbsp;самых темных и&nbsp;светлых фрагментах изображения.<br />\n<br />\n<b>Невидимое подключение</b><br />\nС&nbsp;телевизором Q7C свободного места стало больше. С&nbsp;помощью одного, практически невидимого оптического кабеля вы&nbsp;сможете подключить к&nbsp;телевизору любые внешние устройства и&nbsp;забыть о&nbsp;спутанных&nbsp;ТВ проводах.<br />\n<br />\n<b>Безрамочный экран</b><br />\nДизайн без рамок&nbsp;— впечатления без границ. Отсутствие рамки со&nbsp;всех 4&nbsp;сторон формирует эффект полного погружения. Любые сюжеты оживают перед вашими глазами.', 153285, 'samsung-qe65q7cam', 'Samsung-QE65Q7CAM_2018-08-16_18-35-20.png|Samsung-QE65Q7CAM2_2018-08-16_18-35-27.png|Samsung-QE65Q7CAM3_2018-08-16_18-35-31.png|Samsung-QE65Q7CAM5_2018-08-16_18-35-42.jpg|Samsung-QE65Q7CAM4_2018-08-16_18-35-46.jpg', 'CN32', -1, 1, 'Samsung QE65Q7CAM', 'Samsung QE65Q7CAM купить, CN32, Samsung, QE65Q7CAM', 'Технология QHDR 1500 Выувидите невозможное благодаря технологии расширения динамического диапазона QHDR 1500— изображение глазами режиссера имельчайшие детали объектов, скрытых всамых темных исветлых фрагментах изображения', '', 0, 0, '', '', '', 0, NULL, 'RUR', 153285, '||||', '||||', NULL, 0, 1, '', '', '2018-08-22 05:57:54', 'шт.'),
