(40, 40, 5, 'Дверь межкомнаткая Тенго 22A', '<p>\n	Межкомнатные двери из коллекции Тенго 22&nbsp;изготавливаются из сращенного соснового бруса. Отделка полотна состоит из 3-х вариантов расцветок:&nbsp;Дуб дымчатый,&nbsp;Дуб табак и&nbsp;Слоновая кость. Облицовка поверхности двери осуществляется с использованием влагостойких ДСП-панелей, которые делают возможной установку изделия а помещениях с повышенной влажностью.&nbsp;\n</p>\n\n<p>\n	Размеры:&nbsp;2000х600,&nbsp;2000х700,&nbsp;2000х800,&nbsp;2000х900 мм\n</p>', 3120, 'dver-mejkomnatkaya-tengo-22a', 'dver-mejkomnatkaya-tengo-22a_2018-09-13_15-30-48.jpg', 'CN40', -1, 1, 'Дверь межкомнаткая Тенго 22A', 'Дверь межкомнаткая Тенго 22A купить, CN40,', 'Межкомнатные двери из коллекции Темпо 13 изготавливаются из сращенного соснового бруса.', '', 0, 0, '', '', '', 0, NULL, 'RUR', 3120, '', '', NULL, 0, 1, '', 'Межкомнатные двери из коллекции Тенго 22 изготавливаются из сращенного соснового бруса.', '2018-10-23 10:26:48', 'шт.'),
(41, 41, 5, 'Дверь Мадрид 07', 'Глухая дверь из коллекции Барселона подойдёт для&nbsp;приверженцев&nbsp;классического стиля без лишних деталей.', 7390, 'dver-madrid-07', 'dver-madrid-07_2018-09-13_16-25-32.png', 'CN41', 13, 1, 'Дверь Мадрид ', 'Дверь Мадрид  купить, CN41, Дверь, Мадрид, ', 'Глухая дверь из коллекции Барселона подойдёт для приверженцев классического стиля без лишних деталей.', '', 0, 0, '', '', '', 0, NULL, 'RUR', 7390, '', '', NULL, 0, 1, '', '', '2018-09-18 07:18:46', 'шт.'),
(42, 42, 5, 'Дверь Алясо 13', '<ul>\n	<li>\n		Дверь изготовлена по современной финской технологии из итальянских материалов.\n	</li>\n	<li>\n		Каркас выполнен из сращенного дубового бруса.\n	</li>\n	<li>\n		Влагостойкий ДСП.\n	</li>\n	<li>\n		Толщина полотна 35 мм.\n	</li>\n	<li>\n		Полотно отделано экологичными полипропиленовыми пленками с 3D-эффектом, имитирующими текстуру натурального дерева.\n	</li>\n</ul>\n', 5400, 'dver-alyaso-13', 'dver-alyaso-13_2018-09-13_16-43-02.jpg', 'CN42', -1, 1, 'Дверь Алясо ', 'Дверь Алясо купить, CN42, ', 'Дверь изготовлена по современной финской технологии из итальянских материалов. ', '', 0, 0, '', '', '', 0, NULL, 'RUR', 5400, '', '', NULL, 0, 1, '', '', '2018-09-13 10:46:39', 'шт.'),
(43, 43, 5, 'Дверь Оут-луес 02', '<b>Строение двери:</b>&nbsp;конструкция из 2-х стоевых профильных деталей сечением 110*44мм и поперечных соединительных элементов различных сечений', 8790, 'dver-out-lues-02', 'dver-out-lues-02_2018-09-13_17-47-59.jpg', 'CN43', -1, 1, 'Дверь Оут-луес 02', ' Дверь Оут-луес 02 купить, CN43, ', 'Строение двери:конструкция из 2-х стоевых профильных деталей сечением 110*44мм и поперечных соединительных элементов различных сечений', '', 0, 0, '', '', '', 0, NULL, 'RUR', 8790, '', '', NULL, 0, 1, '', '', '2018-09-13 11:52:07', 'шт.'),
(45, 45, 14, 'Компьютерная акустика Edifier R1700BT', '<p>\n	Edifier R1700BT - замечательный&nbsp;выбор для тех, кто ценит не только высокое качество звука, но и дизайн коробки.\n</p>\n', 7500, 'kompyuternaya-akustika-edifier-r1700bt', 'kompyuternaya-akustika-edifier-r1700bt_2018-09-18_16-50-11.jpg|kompyuternaya-akustika-edifier-r1700bt2_2018-09-18_16-50-24.jpg|kompyuternaya-akustika-edifier-r1700bt3_2018-09-18_16-50-30.jpg', 'CN45', -1, 1, 'Компьютерная акустика Edifier R1700BT', ' купить, CN45, ', 'Edifier R1700BT - прекрасный выбор для тех, кто ценит не только высокое качество звучания, но и внешний вид.', '', 0, 0, '', '', '', 0, NULL, 'RUR', 7500, '||', '||', NULL, 0, 1, '', '', '2018-09-18 10:56:18', 'шт.'),
(46, 46, 14, 'Компьютерная акустика Microlab T10', 'Акустическая система 2.1 cостоит из сабвуфера и двух колонок.&nbsp;Совместима с телевизором, MP3-плеером, персональным компьютером, ноутбуком и любыми другими портативными устройствами.', 10200, 'kompyuternaya-akustika-microlab-t10', 'kompyuternaya-akustika-microlab-t10_2018-09-18_16-58-05.jpg', 'CN46', 17, 1, 'Компьютерная акустика Microlab T10', 'Компьютерная акустика Microlab T10 купить, CN46, Компьютерная, акустика, Microlab, T10', '', '', 0, 0, '', '', '', 0, NULL, 'RUR', 10200, '', '', NULL, 0, 1, '', '', '2018-09-18 11:00:37', 'шт.'),
