(36, 'Тип', 'assortmentCheckBox', NULL, NULL, 0, 1, 44, 0, 'Подавляющее большинство современных телевизоров построены на основе жидкокристаллических матриц (ЖК). Работа плазменной панели построена на принципе работы неоновых ламп. Она представляет собой матрицу из ячеек, заполненных инертным газом и покрытых люминофором. OLED (Organic Light-Emitting Diode) – светоизлучающий диод, созданный на основе органических соединений. В OLED-телевизорах используется матрица из таких светодиодов трех основных цветов. OLED-телевизоры имеют низкое энергопотребление, высокую контрастность, качественную цветопередачу, изображение на экране видно практически под любым углом. К недостаткам можно отнести высокую стоимость.', 'checkbox', '', '', '', 0),
(37, 'Диагональ', 'string', NULL, NULL, 0, 1, 43, 0, 'Диагональ телевизора принято измерять в дюймах (один дюйм равен 2.54 см). Размер экрана стоит выбирать с учетом минимального расстояния от зрителя до телевизора. Для полутора метров рекомендуется экран с диагональю 32 дюйма, для двух метров — 42 дюйма, двух с половиной метров — 50 дюймов, трёх — 60.', 'checkbox', '', '', '', 0),
(49, 'Размер изделия', 'assortment', NULL, NULL, 0, 1, 49, 0, '', 'checkbox', '', '', 'мм', 0),
(38, 'Разрешение', 'string', NULL, NULL, 0, 1, 42, 0, 'Для просмотра телепрограмм в стандартном качестве и DVD-фильмов достаточно иметь экран с разрешением 800x600 точек. Для видеопрограмм с высоким качеством 1080p Full HD потребуется разрешение 1920x1080. Для просмотра видеоконтента со сверхвысоким качеством 4K нужен экран с разрешением 3840x2160.', 'checkbox', '', '', '', 0),
(39, 'Разрешение HD', 'assortmentCheckBox', NULL, NULL, 0, 1, 41, 0, 'Стандарт 720p означает, что изображение будет состоять из 720 строк. Изображение стандарта 1080p состоит из 1080 строк. В этом формате записаны большинство фильмов на Blu-Ray-дисках. Стандарт4K UHD обеспечивает наилучшее качество изображения из всех возможных видеорежимов. Изображение состоит из 2160 строк. Стоит учесть, что видеоконтента с разрешением 4K пока еще мало.', 'checkbox', '', '', '', 0),
